
DECLARE
begin
EXECUTE IMMEDIATE Q'/CREATE OR REPLACE VIEW SPF_V_FADJUSTMAIN AS
SELECT (SELECT S.NAME FROM CODE_T_FIRAGENCY S WHERE S.GUID = A.FIRAGENCYID) FIRAGENCYNAME,
       A.SPFID,
       A.SPFNAME  SPFNAME,
       A.SPFNAME || '{' || A.SPFID || '}' SPFGROUP_NAME,
       (SELECT S.NAME FROM CODE_T_SP_TYPE S WHERE S.GUID = A.PROJTYPEID) PROJTYPENAME,
       A.SPFCODE,
       A.AGENCYID,
        (select  '[' || AGENCY.CODE || ']' || AGENCY.NAME from code_t_firagency  AGENCY where  a.AGENCYID = AGENCY.GUID ) AGENCYNAME,
       A.BEGINYEAR,
       A.ENDYEAR,
       A.EXPFUNCID,
       (SELECT ACCT.CODE
          FROM CODE_V_ACCTCODE_OUT_SPF ACCT
         WHERE ACCT.GUID = A.EXPFUNCID) EXPFUNCCODE,
       (SELECT ACCT.NAME
          FROM CODE_V_ACCTCODE_OUT_SPF ACCT
         WHERE ACCT.GUID = A.EXPFUNCID) EXPFUNCNAME,
       A.CREATETIME,
       FB.SETUPSTATUS,
       A.PROJTYPEID,
       (SELECT V.LEICODENAME
          FROM CODE_V_ACCTCODE_OUT_SPF V
         WHERE V.GUID = A.EXPFUNCID) EXPFUNCCLASS,
       A.FIRAGENCYID,
       A.DEPTID,
       (SELECT  K.NAME FROM  CODE_T_DEPT_SPF  K WHERE K.GUID=A.DEPTID)  AS DEPTNAME ,
       ( SELECT C.NAME FROM FASP_T_CAUSER C WHERE C.GUID=A.CREATEUSER ) AS CREATEUSER ,
       A.DISTRICTID,
       A.ISPUBSHOW,
       A.ISRELEASE,
       A.APPROVALTYPE,
       A.DATAKEY,
       (select ADJUSTSTATUS from SPF_T_FADJUSTSTATUS  where SPFID= A.SPFID) ADJUSTSTATUS
   FROM SPF_T_FBASEINFO A,SPF_T_FBASESTATUS FB WHERE A.SPFID =FB.SPFID/';
